import React, { Component } from 'react';
import axios from "axios";

class Banner extends Component{
    constructor(props) {
        super(props);

    }

    render(){
        return(
            <div className="banner">
                <div>
                    {axios.get('http://localhost:8080')}
                </div>
            </div>
        )
    }
}

export default Banner;
